import React from 'react';
import logo from './logo.svg';
import './App.css';

var names = [
  {name: 'Jashomoti',
   child: ['Jasho','Jashomonti']
  },
  // {name: 'Jashomonti',
  //  child: ['Jashomonty']
  // }
]
function App() {
  class Field extends React.Component{
    constructor(props){
      super(props);
      this.state = {
        name: this.props.info.name,
        child: this.props.info.child
      }
    }

    render(){
     var subs = this.state.child.map((namu) => <h3 className="nameholder child">{namu}</h3>);
      return (
        <div className="namebloc">
          <h3 className="nameholder">{this.state.name}</h3>
          {subs}
        </div>
      );
    }
  }
  var re=[];
  for(let i=0;i<names.length;i++)
   re.push(<Field info={names[i]}/>);
  return re;
}

export default App;
